import { useState } from 'react';
import {
    Box,
    AppBar,
    Toolbar,
    Typography,
    Button,
    Container,
    Paper
} from '@mui/material';
import { useNavigate } from 'react-router-dom';
import { IntegrationForm } from './integration-form';

export const Dashboard = ({ user, onLogout }) => {
    const navigate = useNavigate();
    const [integrationParams, setIntegrationParams] = useState({});

    const handleLogout = () => {
        onLogout();
        navigate('/');
    };

    return (
        <Box sx={{ minHeight: '100vh', bgcolor: '#f5f5f5' }}>
            {/* Header */}
            <AppBar position="static" elevation={0} sx={{ bgcolor: 'white', borderBottom: '1px solid #e0e0e0' }}>
                <Toolbar>
                    <Typography variant="h6" component="div" sx={{ flexGrow: 1, color: '#1976d2', fontWeight: 'bold' }}>
                        Integrations Dashboard
                    </Typography>
                    <Box sx={{ display: 'flex', alignItems: 'center', gap: 2 }}>
                        <Typography variant="body2" color="text.secondary">
                            Welcome, <strong>{user?.username}</strong>
                        </Typography>
                        <Button
                            variant="outlined"
                            onClick={handleLogout}
                            sx={{ 
                                borderColor: '#1976d2', 
                                color: '#1976d2',
                                '&:hover': {
                                    borderColor: '#1565c0',
                                    bgcolor: 'rgba(25, 118, 210, 0.04)'
                                }
                            }}
                        >
                            Logout
                        </Button>
                    </Box>
                </Toolbar>
            </AppBar>

            {/* Main Content */}
            <Container maxWidth="lg" sx={{ py: 4 }}>
                <Paper elevation={2} sx={{ p: 4, borderRadius: 3 }}>
                    <Typography variant="h4" component="h1" gutterBottom sx={{ mb: 3, color: '#1976d2', fontWeight: 'bold' }}>
                        Integration Management
                    </Typography>
                    
                    <IntegrationForm 
                        user={user?.username} 
                        org={user?.username} 
                        integrationParams={integrationParams}
                        setIntegrationParams={setIntegrationParams}
                    />
                </Paper>
            </Container>
        </Box>
    );
};
